<?php

namespace FVCode\PaymentMethodsLogo;

class Logo
{
    /**
     * @var array
     */
    private static $logos = [
        'pix' => 'data:image/png;base64,',
        'boleto' => 'data:image/png;base64,',
        'master' => 'data:image/png;base64,',
        'master-2' => 'data:image/png;base64,',
        'visa' => 'data:image/png;base64,',
        'elo' => 'data:image/png;base64,',
        'american-express' => 'data:image/png;base64,',
        'diners' => 'data:image/png;base64,',
        'ben' => 'data:image/png;base64,',
        'vr' => 'data:image/png;base64,',
        'ticket' => 'data:image/png;base64,',
        'sodexo' => 'data:image/png;base64,',
        'alelo' => 'data:image/png;base64,',
        'hiper' => 'data:image/png;base64,',
        'hipercard' => 'data:image/png;base64,',
        'pagseguro' => 'data:image/png;base64,',
    ];

    /**
     * Retorna o logo da forma de pagamento
     *
     * @param string $pay
     * @return string|null
     */
    public static function get(string $pay): ?string
    {
        return self::$logos[strtolower($pay)] ?? null;
    }

    /**
     * Retorna uma lista das formas de pagamentos
     *
     * @return array|null
     */
    public static function list(): ?array
    {
        return array_keys(self::$logos) ?: null;
    }
}
